class Userlist extends React.Component{
    constructor(props){
        super(props)
        const GCC=cookies.get('name');
        const token=localStorage.getItem("token")
        let loginn=true;
        if(token == null || GCC==null || GCC==''){
            loginn=false
        }
        this.state={
            loginn,
            getlist: []
        }
    }
