        .then(res => {
            const getlist = res.data;
            this.setState({ getlist });
            })
    }
    componentDidMount(){
        this.records();
     }
    close = ()=>{
        cookies.remove('name');
        localStorage.removeItem("token")
        this.props.history.push('/start');
    }
    render(){
        if(this.state.loginn === false) {
